import { useState, useEffect, createContext } from "react";
import { Row, Col, Container } from "reactstrap";
import { read, utils } from "xlsx";

import XLFile from "./data/data.xlsx";

const Filters = ({ handleCreateFilter, selectedFilters }) => {
	return (
		<>
			<p className="text-center mt-2 mb-1 fw-bold">Filter</p>
			<hr />
			<div className="">
				<label htmlFor="" className="fw-bold mb-1">
					Part name
				</label>
				<div className="checkbox">
					<input
						type="checkbox"
						name="PART_NAME_EN"
						id=""
						value="Jodia 1"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; Jodia 1
				</div>
			</div>
			<div className="mt-4">
				<label htmlFor="" className="fw-bold mb-1">
					PS Building Name
				</label>
				<div className="checkbox">
					<input
						type="checkbox"
						name="PSBUILDING_NAME_EN"
						id=""
						value="Branch School-1 Building, Para Area, Jodiya, Jodiya"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; Branch School-1 Building, Para Area, Jodiya, Jodiya
				</div>
			</div>
			<div className="mt-4">
				<label htmlFor="" className="fw-bold mb-1">
					Section Name
				</label>
				<div className="checkbox">
					<input
						type="checkbox"
						name="SECTION_NAME_EN"
						id=""
						value="BRAMAN STREET, JODIA-1"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; BRAMAN STREET, JODIA-1
				</div>
			</div>
			<div className="mt-4">
				<label htmlFor="" className="fw-bold mb-1">
					Firstname
				</label>
				<div className="checkbox">
					<input
						type="checkbox"
						name="FM_NAME_EN"
						id=""
						value="BHAGVATIBEN"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; BHAGVATIBEN
				</div>
				<div className="checkbox">
					<input
						type="checkbox"
						name="FM_NAME_EN"
						id=""
						value="DHIRUBHAI"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; DHIRUBHAI
				</div>
			</div>
			<div className="mt-4">
				<label htmlFor="" className="fw-bold mb-1">
					Lastname
				</label>
				<div className="checkbox">
					<input
						type="checkbox"
						name="LASTNAME_EN"
						id=""
						value="ZALA"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; ZALA
				</div>
				<div className="checkbox">
					<input
						type="checkbox"
						name="LASTNAME_EN"
						id=""
						value="JADEJA"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; JADEJA
				</div>
				<div className="checkbox">
					<input
						type="checkbox"
						name="LASTNAME_EN"
						id=""
						value="PARESHA"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; PARESHA
				</div>
				<div className="checkbox">
					<input
						type="checkbox"
						name="LASTNAME_EN"
						id=""
						value="BABARIYA"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; BABARIYA
				</div>
			</div>
			<div className="mt-4">
				<label htmlFor="" className="fw-bold mb-1">
					Gender
				</label>
				<div className="checkbox">
					<input
						type="checkbox"
						name="GENDER"
						id=""
						value="Male"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; Male
				</div>
				<div className="checkbox">
					<input
						type="checkbox"
						name="GENDER"
						id=""
						value="Female"
						onChange={(e) => handleCreateFilter(e)}
					/>
					&nbsp; Female
				</div>
			</div>
			<div className="mt-4">
				<label htmlFor="" className="fw-bold mb-1">
					Pincode
				</label>
				<div className="checkbox">
					<input type="checkbox" name="PIN_CODE" id="" value="361250" />
					&nbsp; 361250
				</div>
			</div>
		</>
	);
};

const UserRows = ({ user }) => {
	return (
		<tr>
			<td>{user.id}</td>
			<td>{user.name}</td>
			<td>{user.username}</td>
			<td>{user.email}</td>
			<td>{user.phone}</td>
			<td>{user.website}</td>
		</tr>
	);
};

const UserTable = ({ users, selectedFilters, filters }) => {
	const rows = [];

	console.log(users);

	if (filters > 0) {
